import { Link } from 'react-router-dom';

const DUMMY_EVENTS = [
  {
    id: 'e1',
    title: 'A dummy event ONE',
    date: '2023-02-22',
    image:
      'https://blog.hubspot.de/hubfs/Germany/Blog_images/Optimize_Marketing%20eventents%20DACH%202021.jpg',
    description:
      'Join this amazing eventent and connect with fellow deventelopers.',
  },
  {
    id: 'e2',
    title: 'A dummy event TWO',
    date: '2023-02-22',
    image:
      'https://blog.hubspot.de/hubfs/Germany/Blog_images/Optimize_Marketing%20eventents%20DACH%202021.jpg',
    description:
      'Join this amazing eventent and connect with fellow deventelopers.',
  },
  {
    id: 'e3',
    title: 'A dummy event THREE',
    date: '2023-02-22',
    image:
      'https://blog.hubspot.de/hubfs/Germany/Blog_images/Optimize_Marketing%20eventents%20DACH%202021.jpg',
    description:
      'Join this amazing eventent and connect with fellow deventelopers.',
  },
];

const EventsPage = () => {
  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {DUMMY_EVENTS.map((event) => (
          <li key={event.id}>
            <Link to={`/events/${event.id}`}>{event.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
};

export default EventsPage;
